import "bootstrap/dist/css/bootstrap.min.css";
import API from '../../Utils/API/API'
import Container from 'react-bootstrap/Container'
import { useState, useEffect } from "react";
import { Card } from "react-bootstrap";

function Projects(){
   const [state, setState] = useState({repos:{}})
   useEffect(()=>{
       const remoteApiPromise = API.getRepos()
       remoteApiPromise.then((items)=> {
           console.log(items)
           const transfromedData = items.data
           console.log(transfromedData)
           setState((prevState)=> ({
            ...prevState,
            repos: transfromedData
           }))
       })

   },[])


    return(
        <Container fluid>
            <Card>
                <Card.Body>
                    <Card.Title>Repo name</Card.Title>
                    <Card.Text>
                        Repo descriptio

                    </Card.Text>
                    <Card.Link href=''>repo url</Card.Link>

                </Card.Body>

            </Card>

        </Container>

    )
}
export default Projects;
